import React from "react";
// reactstrap components
import { Container, Row, Col, CardBody, CardTitle, Card } from "reactstrap";

import axios from "axios";

// core components
import Navbar from "components/Navbars/Navbar.jsx";
import Purchase from "components/Purchase.jsx";

class Purchases extends React.Component {
  state = {
    squares1to6: "",
    squares7and8: "",
    purchases: []
  };

  async componentWillMount() {
    this.setState({ purchases: await this.fetchPurchases() });
  }

  componentDidMount() {
    document.body.classList.toggle("register-page");
  }

  componentWillUnmount() {
    document.body.classList.toggle("register-page");
  }

  async fetchPurchases() {
    try {
      const products = await axios.get(
        `http://localhost:3001/users/${1}/purchases`
      );
      return products.data;
    } catch (e) {
      console.log(e.message);
    }
    return [];
  }

  render() {
    return (
      <>
        <Navbar />
        <div className="wrapper">
          <div className="page-header">
            <div className="page-header-image" />
            <div className="content">
              <section className="section section-lg">
                <section className="section">
                  <img
                    alt="..."
                    className="path"
                    src={require("assets/img/path4.png")}
                  />
                  <Container>
                    <Row className="row-grid">
                      <Col className="" md="5">
                        <Row>
                          <Col className="px-4 py-2" lg="" sm="12">
                            <Card className="card-stats">
                              <CardBody>
                                <Row>
                                  <Col md="4" xs="5">
                                    <div className="icon-big text-center icon-warning">
                                      <i className="tim-icons icon-gift-2 text-info" />
                                    </div>
                                  </Col>
                                  <Col md="8" xs="7">
                                    <div className="numbers">
                                      <CardTitle tag="p">593</CardTitle>
                                      <p />
                                      <p className="card-category">Presents</p>
                                    </div>
                                  </Col>
                                </Row>
                              </CardBody>
                            </Card>
                          </Col>
                          <Col className="px-2 py-2" lg="6" sm="12">
                            <Card className="card-stats">
                              <CardBody>
                                <Row>
                                  <Col md="4" xs="5">
                                    <div className="icon-big text-center icon-warning">
                                      <i className="tim-icons icon-credit-card text-success" />
                                    </div>
                                  </Col>
                                  <Col md="8" xs="7">
                                    <div className="numbers">
                                      <CardTitle tag="p">10,783</CardTitle>
                                      <p />
                                      <p className="card-category">Forks</p>
                                    </div>
                                  </Col>
                                </Row>
                              </CardBody>
                            </Card>
                          </Col>
                        </Row>
                      </Col>
                    </Row>
                  </Container>
                </section>
              </section>
              <Container>
                <Row style={{ zIndex: 9000 }}>
                  {this.state.purchases.map(purchase => (
                    <Purchase
                      name={purchase.product.name}
                      price={purchase.product.price}
                      date={purchase.created_at}
                      key={purchase.id}
                    />
                  ))}
                </Row>
                <div
                  className="square square-3"
                  id="square3"
                  style={{ transform: this.state.squares1to6 }}
                />
                <div
                  className="square square-4"
                  id="square4"
                  style={{ transform: this.state.squares1to6 }}
                />
                <div
                  className="square square-6"
                  id="square6"
                  style={{ transform: this.state.squares1to6 }}
                />
              </Container>
            </div>
          </div>
        </div>
      </>
    );
  }
}

export default Purchases;
